#
# TABLE STRUCTURE FOR: club_table
#

DROP TABLE IF EXISTS `club_table`;

CREATE TABLE `club_table` (
  `clubID` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `category` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `bio` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `contact` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `clubPhoto` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`clubID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: event_table
#

DROP TABLE IF EXISTS `event_table`;

CREATE TABLE `event_table` (
  `eventID` int(11) NOT NULL AUTO_INCREMENT,
  `clubID` int(11) NOT NULL,
  `title` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `date` date NOT NULL,
  `time` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`eventID`),
  KEY `clubEvent_foreignKey` (`clubID`),
  CONSTRAINT `clubEvent_foreignKey` FOREIGN KEY (`clubID`) REFERENCES `club_table` (`clubID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: membership_table
#

DROP TABLE IF EXISTS `membership_table`;

CREATE TABLE `membership_table` (
  `userID` int(11) NOT NULL,
  `clubID` int(11) NOT NULL,
  `admin` tinyint(1) NOT NULL,
  `memberID` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`memberID`),
  KEY `userID` (`userID`),
  KEY `clubID` (`clubID`),
  CONSTRAINT `club_foreignkey` FOREIGN KEY (`clubID`) REFERENCES `club_table` (`clubID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_foreignkey` FOREIGN KEY (`userID`) REFERENCES `user_table` (`userID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: posts_table
#

DROP TABLE IF EXISTS `posts_table`;

CREATE TABLE `posts_table` (
  `postID` int(11) NOT NULL AUTO_INCREMENT,
  `clubID` int(11) NOT NULL,
  `title` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `content` text COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`postID`),
  KEY `clubPosts_foreignKey` (`clubID`),
  CONSTRAINT `clubPosts_foreignKey` FOREIGN KEY (`clubID`) REFERENCES `club_table` (`clubID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: user_table
#

DROP TABLE IF EXISTS `user_table`;

CREATE TABLE `user_table` (
  `userID` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `realname` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `userPhoto` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `bio` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `siteAdmin` tinyint(1) NOT NULL DEFAULT 0,
  PRIMARY KEY (`userID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



